import ToFill from "./ToFill";
import ToDownload from "./ToDownload";

class FormsMainContent extends React.Component {
  constructor(props) {
    super(props);
    this.state = { forms: "do pobrania" };
  }

  handleChange(e) {
    console.log(e.target.value);
  }

  render() {
    if (this.state.forms == "do pobrania") return <ToDownload />;
    else return <ToFill />;
  }
}

export default FormsMainContent;
